import React from "react";
import "./App.css";
import w3w from "./logos/w3w.png";
import kakao from "./logos/kakaomap.png";
import x from "./logos/x.png";
import Swal from "sweetalert2";

class Header extends React.Component {
  render() {
    // eslint-disable-next-line
    return (
      <div>
        <h1 className="Header">
          <p className="typing">지금. 당신이. 서 있는 곳.</p>
        </h1>
        <div className="imgholder">
          <img
            className="Logo1"
            src={w3w}
            alt="w3w"
            onClick={() =>
              Swal.fire({
                title: "<strong>Do you know W3W?</strong>",
                icon: "warning",
                html: `You really can't go back after this, We can't retrieve it either!`,
                showCloseButton: true,
                showCancelButton: true,
                focusConfirm: false,
                reverseButtons: true,
                focusCancel: true,
                cancelButtonText: `I know!`,
                confirmButtonText: `I don't know!`,
                background: "white",
                color: "midnightblue",
                backdrop: `
    rgba(0,0,123,0.4)
    url("https://sweetalert2.github.io/images/nyan-cat.gif")
    left top
    no-repeat
  `,
              }).then((result) => {
                if (result.value) {
                  window.location.href = `/real_world`;
                }
              })
            }
          />
          <img className="xImg" src={x} alt="x"></img>
          <img
            className="Logo2"
            src={kakao}
            alt="kakao"
            onClick={() =>
              Swal.fire({
                title: "What is KakaoMap?",
                width: 600,
                padding: "3em",
                background: "white",
                color: "midnightblue",
                backdrop: `
    rgba(0,0,123,0.4)
    url("https://sweetalert2.github.io/images/nyan-cat.gif")
    left top
    no-repeat
  `,
              })
            }
          />
          <div>
            {/* <div className="textholder">
              <span className="imgtext">W3W</span>
              <span className="imgtext">KaKaoMap</span>
            </div> */}
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
